import React, { Component } from 'react'
import './footer.css'
import { Row, Col } from 'antd'


class Footer extends Component {
    render() {
        return (
            <div className="footer">
               <Row>
                   <Col span={8}></Col>
               </Row>
            </div>
        )
    }
}

export default Footer;
